`,paraId:101,tocIndex:23},{value:"\u8DDF",paraId:102,tocIndex:23},{value:"53.\u6700\u5927\u5B50\u6570\u7EC4\u548C",paraId:103,tocIndex:23},{value:"\u76F8\u540C",paraId:102,tocIndex:23},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
var maxSubArray = function (nums) {
    const n = nums.length;
    // dp[i]\u8868\u793Anums[0..i]\u7684\u6700\u5927\u548C
    let dp = new Array(n).fill(0);

    // base case
    dp[0] = nums[0];
    let max = nums[0];
    for (let i = 1; i < n; i++) {
        dp[i] = Math.max(dp[i - 1] + nums[i], nums[i]);
        max = Math.max(max, dp[i]); // \u66F4\u65B0max
    }

    return max;
};
