`,paraId:13,tocIndex:7},{value:`// \u5341\u8FDB\u5236\u8F6C\u4E8C\u8FDB\u5236
function dec2bin(decNumber) {
  var stack = new Stack();
  while (decNumber > 0) {
    stack.push(decNumber % 2);
    decNumber = Math.floor(decNumber / 2);
  }

  var binaryString = '';
  while (!stack.isEmpty()) {
    binaryString += stack.pop();
  }
  return binaryString;
}
console.log(dec2bin(100)); // 110010
`,paraId:14,tocIndex:9},{value:"\u6709\u6548\u7684\u62EC\u53F7",paraId:15,tocIndex:9},{value:"\u89E3\u9898\u601D\u8DEF\uFF1A",paraId:16,tocIndex:10},{value:"\u4F7F\u7528\u6808\u7ED3\u6784\u5148\u8FDB\u540E\u51FA\u7684\u7279\u6027",paraId:16,tocIndex:10},{value:"\u5148\u58F0\u660E\u4E00\u4E2A\u6808 stack \u53D8\u91CF",paraId:16,tocIndex:10},{value:"\u904D\u5386\u6574\u4E2A\u5B57\u7B26\u4E32",paraId:16,tocIndex:10},{value:"\u53D1\u73B0 ( \u3001 {\u3001 [ \u5C31\u5165\u6808",paraId:16,tocIndex:10},{value:"\u53D1\u73B0 )\u3001}\u3001] \u5C31\u548C\u6808\u9876\u505A\u6BD4\u8F83\uFF0C\u82E5\u6808\u9876\u5B58\u5728\u5BF9\u5E94\u7684\u62EC\u53F7\uFF0C\u5C06\u4E0E\u4E4B\u5BF9\u5E94\u7684\u62EC\u53F7\u51FA\u6808",paraId:16,tocIndex:10},{value:"\u904D\u5386\u7ED3\u675F\u540E\uFF0C\u82E5\u6808\u7A7A\uFF0C\u5219\u8BF4\u660E\u6240\u6709\u62EC\u53F7\u90FD\u80FD\u627E\u5230\u76F8\u5339\u914D\u7684",paraId:16,tocIndex:10},{value:`/**
 * @param {string} s
 * @return {boolean}
 */
var isValid = function (s) {
  if (s.length % 2 === 1) {
    return false;
  }
  var stack = [];
  var length = s.length;
  var map = new Map();
  map.set('(', ')');
  map.set('{', '}');
  map.set('[', ']');

  for (var i = 0; i < length; i++) {
    var c = s[i];
    if (map.has(c)) {
      stack.push(c);
    } else {
      var stackTop = stack[stack.length - 1];
      if (map.get(stackTop) === c) {
        // \u6808\u9876\u5143\u7D20\u51FA\u6808
        stack.pop();
      } else {
        // \u6808\u9876\u5143\u7D20\u4E0E\u5F53\u524D\u5143\u7D20\u4E0D\u5339\u914D \u201C})\u201D "])" return
        return false;
      }
    }
  }
  return stack.length === 0 ? true : false;
};
