`,paraId:4,tocIndex:2},{value:"34.\u5728\u6392\u5E8F\u6570\u7EC4\u4E2D\u67E5\u627E\u5143\u7D20\u7684\u7B2C\u4E00\u4E2A\u548C\u6700\u540E\u4E00\u4E2A\u4F4D\u7F6E",paraId:0},{value:"medium",paraId:5,tocIndex:2},{value:"\u8DDF",paraId:6,tocIndex:3},{value:"\u5251\u6307 Offer 53 - I. \u5728\u6392\u5E8F\u6570\u7EC4\u4E2D\u67E5\u627E\u6570\u5B57 I",paraId:7,tocIndex:3},{value:"\u76F8\u4F3C",paraId:6,tocIndex:3},{value:`/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number[]}
 */
var searchRange = function (nums, target) {
  if (nums.length === 0) return [-1, -1];
  return [leftSearch(nums, target), rightSearch(nums, target)];
};

var leftSearch = (nums, target) => {
  let left = 0,
    right = nums.length - 1;
  while (left <= right) {
    let mid = left + Math.floor((right - left) / 2);
    if (nums[mid] < target) {
      left = mid + 1;
    } else if (nums[mid] > target) {
      // \u641C\u7D22\u533A\u95F4\u53D8\u4E3A [left, mid-1]
      right = mid - 1;
    } else if (nums[mid] === target) {
      // \u641C\u7D22\u533A\u95F4\u53D8\u4E3A [left, mid-1]
      right = mid - 1; //\u6CE8\u610F
    }
  }

  // left \u662F\u7684\u533A\u95F4\u662F[0,nums.length]
  // if (left === nums.length) return -1; // \u8D8A\u754C
  return nums[left] === target ? left : -1;
};

var rightSearch = (nums, target) => {
  let left = 0,
    right = nums.length - 1;

  while (left <= right) {
    let mid = left + Math.floor((right - left) / 2);
    if (nums[mid] < target) {
      left = mid + 1;
    } else if (nums[mid] > target) {
      right = mid - 1;
    } else if (nums[mid] === target) {
      left = mid + 1; //\u6CE8\u610F
    }
  }

  // if (left - 1 < 0) return -1;// \u9632\u6B62\u8D8A\u754C
  // return nums[left - 1] === target ? right : -1;
  // \u5F53while\u7ED3\u675F\u65F6\uFF0Cleft-1=right;
  // if (right < 0) return -1;// \u9632\u6B62\u8D8A\u754C
  return nums[right] === target ? right : -1;
};
